/**
* @title MentaportDynamic
* @dev Extending MentaportMint - MentaportERC721
Adds functionality to have dynamic state upgrades of NFT tokens with defined rules
*/
contract MentaportDynamic is MentaportMint {

  bool public useDynamicRules = true;
  mapping(uint256 => int256) internal _tokenState;
  mapping(int256 => string) internal _stateURI;
  int256 private _recentStateSet = 0;

  constructor(
    string memory _name,
    string memory _symbol,
    string memory _initNotRevealedUri,
    uint256[] memory _mintTrulesS,
    uint256[] memory _mintTrulesE
  ) MentaportMint(_name, _symbol, _initNotRevealedUri, _mintTrulesS,_mintTrulesE) 
  {

  }

  //----------------------------------------------------------------------------
  // Public functions

  //----------------------------------------------------------------------------
  // Public functions that are View
  function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
    require(_exists(tokenId), "MentaportDynamic: URI query for nonexistent token");

    if(revealed == false) {
      return notRevealedUri;
    }
    int256 state = _tokenState[tokenId];
    string memory currentStateURI = _stateURI[state];
    return bytes(currentStateURI).length > 0
      ? string(abi.encodePacked(currentStateURI, Strings.toString(tokenId), baseExtension))
      : "";
  }

  //----------------------------------------------------------------------------
  // Public Only owner + mentaport
  function reveal() override public onlyOwner {
    require(!useDynamicRules, "MentaportDynamic: use revealDynamic");
    revealed = true;
  }

  function revealDynamic(string memory _newBaseURI) virtual public onlyOwner {
    _recentStateSet = 0;
    _stateURI[_recentStateSet] = _newBaseURI;
    revealed = true;
  }

  function useUseDynamicRules(bool _state) public onlyOwner {
    useDynamicRules = _state;
  }
  function recentStateSet() public view  onlyOwner returns (int256)  {
    return _recentStateSet;
  }

  //----------------------------------------------------------------------------
  // External Only owner + mentaport
  function updateDynamicStateAll(int256 nstate, string memory _newBaseURI) external onlyOwner {
    require(_recentStateSet == nstate - 1, "MentaportDynamic: Wrong state provided");
    for(uint i = 0; i < totalSupply(); i++) {
      _tokenState[i] = nstate;
    }
    _recentStateSet = nstate;
    _stateURI[nstate] = _newBaseURI;
  }

  function updateDynamicState(uint256 tokenId, string memory _newBaseURI, int256 _updateState) external onlyOwner {
    require(_exists(tokenId), "MentaportDynamic: query for nonexistent token");

    int256 nstate = _tokenState[tokenId] + _updateState;
    _tokenState[tokenId] = nstate;
    _stateURI[nstate] = _newBaseURI;
    if(_recentStateSet < nstate) {
      _recentStateSet = nstate;
    }

  }
}

